DROP TABLE IF EXISTS `product`;
CREATE TABLE `product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_name` varchar(255) DEFAULT NULL COMMENT 'ten san pham',
  `price` varchar(255) DEFAULT NULL COMMENT 'gia tinh tien',
